export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: "comName",
    Row: (props) => {
      onClickRow()
      console.log(props.sci)
    }
  },
  {
    Header: "Scientific Name",
    accessor: "sciName",
    Cell: (props) => {
      return (
        <td
         
          sci={props.sci}
        >
          {props.cell.value}
        </td>
      );
    },
  },
  {
    Header: "Location",
    accessor: "locName",
  },
  {
    Header: "Date",
    accessor: "obsDt",
  },
];
